import React from 'react';
import './LockSeat.css';
import Button from "../button/Button";

const LockSeat = (props) => {
  return (
    <div className='lock-seat'>
      <div className='seat-detail'>座位已锁定，座位为：{props.seatLocation}</div>
      <Button class={'train-tickets-button-default'} text={'付款'}/>
    </div>
  );
};

export default LockSeat;
